INSERT INTO `BUG` VALUES (1,'Escarabat de molla','Escarabajo de muelle','Click beetle',955,'Lacon','punctatus','cat: Els escarabats de la família Elateridae es diuen escarabats de molla per la seva curiosa capacitat de saltar quan han caigut d\'esquena i redreçar-se en tornar a caure al terra. Clicking s\'utilitza sobretot per evitar la predació; esp: Los escarabajos de la familia Elateridae se llaman escarabajos de muelle o de resorte por su curiosa capacidad de saltar cuando han caído de espaldas, y aderezarse al volver a caer a tierra. Clicking se utiliza sobretodo para evitar la predación; eng: Elateridae beetles are called click or spring beetles for its curious ability to jump when they have fallen back. Clicking is used mainly to avoid predation.',NULL),(2,'Escarabat de molla','Escarabajo de muelle','Click beetle',955,'Agrypnus','murinus','cat: Agrypnus murinus és el mateix que Adelocera murina. Els escarabats de la família Elateridae es diuen escarabats de molla per la seva curiosa capacitat de saltar quan han caigut d\'esquena i redreçar-se en tornar a caure al terra. Clicking s\'utilitza sobretot per evitar la predació; esp: Agrypnus murinus es sinónimo de Adelocera murina. Los escarabajos de la fami­lia Elateridae se llaman escarabajos de muelle o de resorte por su curiosa capacidad de saltar cuando han caído de espaldas, y aderezarse al volver a caer a tierra. Clicking se utiliza sobretodo para evitar la predación; eng: Agrypnus murinus is the same as Adelocera murina. Elateridae beetles are called click or spring beetles for its curious ability to jump when they have fallen back. Clicking is used mainly to avoid predation.',NULL),(3,'Escarabat carronyer','Escarabajo carroñero','carrion beetle, burying beetle',999,'Phosphuga','atrata','cat: Poden retreure el cap fins amagar-lo. No s\'alimenten de carronya sinó de caragols; esp: Pueden retraer la cabeza hasta esconderla. No se alimentan de carroña sino de caracoles; eng: They can retract their heads to hide. Do not feed on carrion but snails.',' > subfamily: Silphinae'),(4,'Brunidora, escarabat de les flors','Escarabajo del sudario','White-spotted Rose Beetle',983,'Oxythyrea','funesta','cat: Quan vola fa un zumzeig semblant al de l\'abella. S\'alimenta de les parts tendres d\'algunes flors. Els individus joves tenen molts pèls, però els van perdent amb el desgast; esp: Cuando vuela hace un zumbido similar al de la abeja. Se alimenta de las partes tiernas de algunas flores. Los imagos jóvenes tienen muchos pelos, pero los van perdiendo con el desgaste; eng: When it flies sounds like a buzzing bee. It feeds on the tender parts of some flowers. The young imagos have many hairs, but are lost with time.',' > subfamily: Cetoniinae > tribe: Cetoniini > subtribe: Leucocelina'),(5,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(6,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(7,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(8,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(9,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(10,'Vernat pudent','Chinche de escudo verde','Green Shield bug',674,'Palomena','prasina','cat: Quan moren desprenen una olor desagradable. Acostumen a entrar a les cases; esp: Cuando mueren desprenden un olor desagradable. Asociadas a los hábitats humanos; eng: Unpleasant odor when dying.',' > subfamily: Pentatominae'),(11,'Mosca de la carn','Moscarda gris de la carne','Flesh fly',1242,'Sarcophaga','carnaria','cat: És difí­cil distingir les diferents espècies. Estan associades a l\'home. Poden provocar infeccions en les ferides; esp: Es difí­cil distinguir las diferentes especies. Están asociadas al hombre. Pueden provocar infecciones en las heridas; eng: Difficult to distinguish among species. Associated with humans and wound infections.',' > subfamily: Sarcophaginae'),(12,'Panorpa comuna, mosca escorpí','Panorpa común, mosca escorpión','Common scorpionfly',1059,'Panorpa','communis','cat: Els mascles tenen unes càpsules genitals vermelles a l\'extrem de l\'abdomen, acabat amb una punxa que recorda un escorpí­, i que serveix per subjectar la femella durant l\'aparellament. El cap es prolonga en un llarg rostre a l\'extrem del qual se situen les peces bucals; esp: Los machos tienen unas cápsulas genitales rojas en el extremo del abdomen, acabado en pincho que recuerda a un escorpión, y sirve para sujetar la hembra en la cópula. La cabeza se prolonga en un largo rostrum en cuyo extremo se situan las piezas bucales; eng: The male has a pair of claspers at the end of its tail (for holding the female during mating), giving it a scorpion-like appearance, although it is not a stinger. Its head, mounted with large eyes, is drawn into a prominent, downward pointing beak (rostrum), which opens at the tip of its head.',NULL),(13,'Arna','Polilla','Moth',1491,'Adela','australis','cat: Els microlepidòpters són el grup de papallones més antic, a partir del qual van evolucionar les papallones més grosses amb colors vistosos; esp: Los microlepidópteros son el grupo de mariposas más antiguo, a partir del que evolucionaron las mariposas más grandes y con colores vistosos; eng: Microlepidopters are the oldest butterflies group, from which more colourful butterflies evolved.',NULL),(14,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(15,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(16,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(17,'Xinxa de les carbasses, xinxa pudent','Chinche del cuero','Dock Leaf Bug',683,'Coreus','marginatus',NULL,NULL),(18,'Dicranocephalus albipes','Dicranocephalus albipes','Dicranocephalus albipes',686,'Dicranocephalus','albipes',NULL,NULL),(19,'Xinxa roja o de les malves','Chinche roja o de las malvas','Firebug',703,'Pyrrhocoris','apterus','cat: Altres noms: coralet, poll de moro.',NULL),(20,'Hidròmetra','Medidor de los estanques','Water Measurer',630,'Hydrometra','stagnorum',NULL,NULL),(21,'Anisops sardea','Anisops sardea','Backswimmer',655,'Anisops','sardea','cat: Neden potes amunt; esp: Nadan patas arriba; eng: They are backswimmer.',NULL),(22,'Mosca xoriguer','Mosca cernícalo','Hoverfly',1166,'Eupeodes','corollae',NULL,NULL),(23,'Mosca xoriguer','Mosca cernícalo','Marmalade Hoverfly',1166,'Episyrphus','balteatus',NULL,NULL),(24,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(25,'Camponotus cruentatus','Camponotus cruentatus','Camponotus cruentatus',742,'Camponotus','cruentatus','cat: Les Camponotus són de les formigues més grans de la Península Ibèrica; esp: Las Camponotus son de las hormigas más grandes de la Pení­nsula Ibérica; eng: Camponotus are among the biggest ants in the Iberian Peninsula.',' > subfamily: Formicinae'),(26,'Crisopa comuna','Crisopa común','Lacewing',1034,'Chrysoperla','carnea','cat: Ales en forma de teulat en posició de repòs. Hi ha espècies similars menys comunes i que només es poden distingir per la venació alar. Es poden utilitzar per combatre plagues de pugons; esp: Alas en forma de tejado en posición de reposo. Hay especies similares menos comunes y que sólo se pueden distinguir por la venación alar. Se pueden utilizar para combatir plagas de pulgones; eng: Roof shaped wings. Other species less common are very similar. Could be useful against aphid plagues.',NULL),(27,'Pugó','Pulgón','Aphid',1521,'Uroleucon','sp','cat: Molt petit.; esp: Muy pequeño.; eng: Very small.',NULL),(28,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(29,'Marieta de 16 punts','Mariquita de 16 puntos','16-spot Ladybird',872,'Tytthaspis','sedecimpunctata','cat: Marieta molt petita, 3mm.; esp: Mariquita muy pequeña, 3mm.; eng: Very small ladybird, 3mm.',' > subfamily: Coccinellinae > Tribe: Thyttaspididini'),(30,'Rhagonycha fulva','Rhagonycha fulva','Soldier beetle',952,'Rhagonycha','fulva',NULL,NULL),(31,'Mosca del fems','Mosca del estiércol','Dung fly',1237,'Scathophaga',NULL,NULL,NULL),(32,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(33,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(34,'Per a identificar','Para identificar','For ID',12,NULL,NULL,NULL,NULL),(35,'Per a identificar','Para identificar','For ID',12,NULL,NULL,NULL,NULL),(36,'Esfinx de les lletereses','Esfinge de las lechetreznas','Spurge Hawk-moth',1450,'Hyles','euphorbiae','cat:  Papallona nocturna (arna, polilla) coneguda com esfinx de l\'eufòrbia o de la lleteresa, en al.lusió a la planta de la que s\'alimenta l\'eruga. Aquesta papalllona nocturna (heteròceros) es considera en l\'actualitat una espècie rara, i a moltes zones s\'ha extingit. L\'eruga té una de les més boniques coloracions i dissenys dins de la Pení­nsula Ibèrica. En l\'eruga, segons es pot observar, hi ha una certa variabilitat en la coloració i en el níumero i forma dels punts. Efectivament, hi ha bastanta variabilitat com es pot llegir i veure a http://tpittaway.tripod.com/sphinx/h_eup.htm; esp: Mariposa nocturna (polilla) conocida como esfinge de la euforbia o de las lechetreznas, pues la oruga se alimenta de euforbias. Esta mariposa nocturna se considera una especie rara, y en muchas zonas se ha extinguido. La oruga tiene una de las coloraciones más vistosas de las que se pueden ver en la Península Ibŕrica. La oruga tiene una cierta variabilidad en la coloración y en el número y forma de los puntos. Efectivamente, hay bastante variabilidad como se puede leer y ver en http://tpittaway.tripod.com/sphinx/h_eup.htm; eng: Moth called Spurge Hawk-moth, because caterpillar is associated and eats spurge plants. Quite rare actually. Caterpillar has the nicest designs of Iberian Peninsula caterpillars. Colour and design changes as you can see and read in http://tpittaway.tripod.com/sphinx/h_eup.htm.',NULL),(37,'Berosus hispanicus','Berosus hispanicus','Berosus hispanicus',992,'Berosus','hispanicus',NULL,NULL),(38,'Mosca de potes llargues','Mosca de patas largas','Long-Legged Fly',1157,'Hydrophorus','praecox','cat: Les potes llargues és una adaptació per poder-se estar sobre l\'aigua i poder-se alimentar del que troben en els bassals. Mosques predadores; esp: Las patas largas es una adaptación para poderse estar sobre el agua y poderse alimentar de lo que encuentran en los charcos. Moscas predadoras; eng: Long legs is an adaptation for treading on the water, and feed in the ponds and stagnant water. Predator flies.',' > subfamily: Hydrophorinae'),(39,'Empis sp','Empis sp','Empis sp',1158,'Empis','sp','cat: Mosca molt petita, difí­cil de distingir respecte altres gèneres i algunes famílies de dí­pters.;esp: Mosca muy pequeña, difícil de distinguir respecto a los otros géneros y otras familias de díptera.;eng: Little fly, difficult to distinguish among other genus and other diptera families.',NULL),(40,'Marieta de set punts','Mariquita de siete puntos','Seven-spot ladybird',872,'Coccinella','septempunctata','cat: La Coccinella septempunctata o marieta de set punts és la més comuna de les marietes a Europa. Té els èlitres de color vermell, cadascun amb tres punts negres. Té un altre punt en la unió dels dos èlitres, així doncs, són set punts en total, d\'on deriva el seu nom cientí­fic. Abarca ecosistemes molt amplis, vivint allà  on hi ha àfids per menjar.;esp: La Coccinella septempunctata o mariquita de siete puntos es la más común de las mariquitas en Europa. Tiene los élitros de color rojo, cada uno con tres puntos negros. Tiene otro punto en la unión de los dos élitros, así pues, son siete puntos en total, de donde deriva su nombre científico. Abarca ecosistemas muy amplios, viviendo allí donde hay áfidos para comer.;eng: Coccinella septempunctata, the seven-spot ladybird (or, in North America, seven-spotted ladybug), is the most common ladybird in Europe. Its elytra are of a red colour, but punctuated with three black spots each, with one further spot being spread over the junction of the two, making a total of seven spots, from which the species derives both its common and scientific names. Has a broad ecological range, living almost anywhere there are aphids for it to eat.',' > subfamily: Coccinellinae > tribe: Coccinellini'),(41,'Vespa','Avispa','European paper wasp',750,'Polistes','dominula','cat: Polistes dominula (la vespa europea del paper), és de les espècies de vespes socials més ben conegudes d\'Europa. La Polistes gallicus també és una espècie comuna, quasi indestingible de la Polistes dominula (ambdues s\'han confós continuament). La referència de vespsa del paper és perquè fa els nius de paper (amb la saliva estova la cel.lulosa i fa una pasta).;esp: Polistes dominula (la avispa europea del papel), es de las especies de avispas sociales más bien conocidas de Europa. La Polistes gallicus también es una especie común, casi indistinguible de la Polistes dominula (las dos se han confundido continuamente). La referencia de avispa del papel es porque hace los nidos de papel (con la saliva ablanda la celulosa y hace una pasta).;eng: Polistes dominula (the European paper wasp), is one of the more common and well-known species of social wasps in Europe. Polistes gallicus is a fairly common species of European paper wasp, almost indistinguishable from the Polistes dominula, with which it had long been confused. The name paper wasp is because the nest is made from cellulosa.',' > subfamily: Vespinae'),(42,'Vespa','Avispa','Wasp',750,'Polistes','nimpha','cat: identificació difícil;esp: difí­cil identificación;eng: difficult ID',' > subfamily: Vespinae'),(43,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(44,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(45,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(46,'Cidnopus pilosus','Cidnopus pilosus','Cidnopus pilosus',955,'Cidnopus','pilosus',NULL,NULL),(47,'Hysteropterum sp','Hysteropterum sp','Planthopper',584,'Hysteropterum','sp',NULL,NULL),(48,'Cercopis intermedia','Cercopis intermedia','Cercopis intermedia',561,'Cercopis','intermedia','cat: Parents llunyans de les cigal.les i els pugons, els cercòpids són més coneguts pels nius d\'escuma que les larves de moltes espècies construeixen per protegir-se dels depredadors i la deshidratació. En la Península Ibèrica habiten 3 espècies, però només Cercopis intermedia és habitual, resultant fàcil distingir-la pels seus genolls vermells.;esp: Parientes lejanos de las cigarras y los pulgones, los cercópidos son más conocidos por los nidos de espuma que las larvas de muchas especies construyen para protegerse de los depredadores y la deshidratación. En la Pení­nsula Ibérica habitan 3 especies, pero solo Cercopis intermedia es común, resultando fácil reconocerla por sus rodillas rojas.',NULL),(49,'Eurydema ornata','Eurydema ornata','Ornate Shieldbug',674,'Eurydema','ornata','cat: El patró de colors negre i vermell és bastant comú en els insectes: coloració aposemàtica. Per saber la diferència entre Eurydema ornata i Eurydema ventralis, dos enllaços: http://biocostagranadina.blogspot.com.es/2011/07/chinche-de-las-cruciferas-eurydema.html i http://www.flickr.com/photos/fturmog/3027284240/;esp: El patrón de colores negro y rojo es bastante común en los insectos: coloración aposemática. Para saber la diferencia entre Eurydema ornata y Eurydema ventralis, dos enlaces: http://biocostagranadina.blogspot.com.es/2011/07/chinche-de-las-cruciferas-eurydema.html y http://www.flickr.com/photos/fturmog/3027284240/;eng: Red and black colour scheme is common in bugs. To know the difference between Eurydema ornata and Eurydema ventralis, two links: http://biocostagranadina.blogspot.com.es/2011/07/chinche-de-las-cruciferas-eurydema.html and http://www.flickr.com/photos/fturmog/3027284240/',NULL),(50,'Mosca serp','Mosca serpiente','Snakefly',1015,'Atlantoraphidia','maculicollis','cat: L\'ordre Raphidioptera només disposa de dues famí­lies, una d\'elles la Raphidiidae, i és freqüent en Europa Central i Nord, però rara en Europa del Sud. És difícil la identificació de l\'espècie. Abans eren considerats neuròpters.;esp: El orden Raphidioptera sólo dispone de dos familias, una de ellas la Raphidiidae, y es frecuente en Europa Central y Norte, pero rara en Europa del Sur. Es difí­cil la identificación de la especie. Antes eran considerados neurópteros.;eng: The order Raphidioptera has only two families, one of them Raphidiidae, and is common in Central and Northern Europe, but rare in Southern Europe. The species are difficult to identify. Were previously considered Neuroptera.',NULL),(51,'Trichodes apiarius','Trichodes apiarius','Checkered beetle, bee beetle',859,'Trichodes','apiarius','eng: It is an hairy small beetle with shining blue or black head and scutellum. The elongated elytra show a bright red colour with black bands. This species can easily be distinguished from Trichodes alvearius for the black terminal band reaching the apex of elytra.',' > subfamily: Clerinae'),(52,'Tritomegas sexmaculatus','Tritomegas sexmaculatus','Tritomegas sexmaculatus',669,'Tritomegas','sexmaculatus','cat: Forma part de la superfamí­lia dels Pentatomoidea, però no és un Pentatomoidae, és un Cydnidae',NULL),(53,'Peixet de plata','Pececillo de plata','Silverfish',222,'Lepisma','saccharina','esp: Pertenece a un grupo muy antiguo, los tisanuros, con restos fósiles de cerca de 400 millones de años de edad. Los tisanuros son considerados los insectos verdaderos de rasgos más primitivos, careciendo primariamente de alas (en otros insectos esta carencia es el resultado secundario de su pérdida evolutiva). El brillo metálico de su cuerpo se debe a sus escamas plateadas, que aparecen después de su tercera muda. Las ninfas de las primeras fases o estadios son blanquecinas. Presenta dos largas antenas en la cabeza y otros tres apéndices semejantes en la parte posterior (cola de cerdas)',NULL),(54,'Clytra quadripunctata','Clytra quadripunctata','Clytra quadripunctata',850,'Clytra','quadripunctata',NULL,' > subfamily: Cryptocephalinae'),(55,'Tisoretes','Tijeretas','Earwig',373,'Forficula','auricularia',NULL,' > subfamily: Forficulinae'),(56,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(57,'Aranya','Araña','Spider',14,NULL,NULL,NULL,NULL),(58,'Aranya'