, pero solo Cercopis intermedia es común, resultando fácil reconocerla por sus rodillas rojas.',NULL),(1152,'130519_115516.JPG','Lagria sp',4187932,5184,3456,'F3.2*100.0 mm*1/160 s*Canon*Canon EOS 550D*',164,'bitxo',14,1,NULL,1,'9008421970',NULL,NULL),(1153,'130519_115522.JPG','Lagria sp',4114899,5184,3456,'F2.8*100.0 mm*1/160 s*Canon*Canon EOS 550D*',164,'bitxo',14,2,NULL,NULL,NULL,NULL,NULL),(1154,'130609_120132.JPG','Cicindela maroccana',7368918,5184,3456,'F8*100.0 mm*1/2500 s*Canon*Canon EOS 550D*',202,'bitxo',2,5,NULL,NULL,NULL,NULL,NULL),(1155,'130609_120154.JPG','Cicindela maroccana',7049878,5184,3456,'F8*100.0 mm*1/2000 s*Canon*Canon EOS 550D*',202,'bitxo',2,1,NULL,1,'9007243357',NULL,NULL),(1156,'130609_120216.JPG','Cicindela maroccana',6742473,5184,3456,'F8*100.0 mm*1/2500 s*Canon*Canon EOS 550D*',202,'bitxo',2,2,NULL,NULL,NULL,NULL,NULL),(1157,'130609_120237.JPG','Cicindela maroccana',6708749,5184,3456,'F8*100.0 mm*1/2000 s*Canon*Canon EOS 550D*',202,'bitxo',2,4,NULL,NULL,NULL,NULL,NULL),(1158,'130609_120324.JPG','Cicindela maroccana',6912220,5184,3456,'F16*100.0 mm*1/400 s*Canon*Canon EOS 550D*',202,'bitxo',2,3,NULL,NULL,NULL,NULL,NULL),(1159,'130609_120312.JPG','Cicindela maroccana',6912220,5184,3456,'F16*100.0 mm*1/400 s*Canon*Canon EOS 550D*',202,'bitxo',2,6,NULL,NULL,NULL,NULL,NULL),(1160,'130609_120320.JPG','Cicindela maroccana',6912220,5184,3456,'F16*100.0 mm*1/400 s*Canon*Canon EOS 550D*',202,'bitxo',2,7,NULL,NULL,NULL,NULL,NULL),(1161,'130609_120144.JPG','Cicindela maroccana',6912220,5184,3456,'F16*100.0 mm*1/400 s*Canon*Canon EOS 550D*',202,'bitxo',2,8,NULL,NULL,NULL,NULL,NULL),(1162,'130609_120146.JPG','Cicindela maroccana',6912220,5184,3456,'F16*100.0 mm*1/400 s*Canon*Canon EOS 550D*',202,'bitxo',2,9,NULL,NULL,NULL,NULL,NULL),(1163,'130609_104038.JPG','Anthaxia hungarica',6132338,5184,3456,'F8*100.0 mm*1/250 s*Canon*Canon EOS 550D*',80,'bitxo',2,5,NULL,NULL,NULL,NULL,NULL),(1164,'130609_104040.JPG','Anthaxia hungarica',6199956,5184,3456,'F8*10